import React from "react";
import CardFavorites from "./CardFavorites.jsx";
import { useSelector } from "react-redux";

const Favorites = () => {
  const user = useSelector((state) => state.user);

  const [favorites, setFavorites] = React.useState([]);

  React.useEffect(() => {
    setFavorites(user.favoritesId);
  }, []);

  return (
    <React.Fragment>
      {favorites?.map((fav, i) => {
        return <CardFavorites key={i} movieID={fav} />;
      })}
    </React.Fragment>
  );
};

export default Favorites;
